import React, { Component } from 'react';
import AppHeader from './header/AppHeader.js'
import AppContent from './homePage/AppContent.js'
import AppFooter from './footer/AppFooter.js'

import RegisterContent from './register/RegisterContent'

import 'bootstrap/dist/css/bootstrap.css';

class App extends Component {

    render() {
        return(
            <div id="main">
                <AppHeader/>
                <AppContent/>
                <AppFooter/>
            </div>
        )
    }
}

export default App;
